function Header() {
    return (
        <header className={ window.location.href.includes("/saved-news") ? "header header_black": "header"}>
          <div>NewsExplorer</div>
          <Navigation isLogged={false} name="Eliseeeeeeeeeeeeee"/>
          <div className="header__menu-icon"></div>
        </header>
    );
}

export default Header;
